import React from 'react'
import MenuItem from '@skbkontur/react-ui/MenuItem'

class Menu extends React.Component{

    render(){
        return(
            <div>
                <MenuItem title='Главная'/>
                <MenuItem title="Мои курсовые"/>
                <MenuItem title="Свободные курсовые"/>
            </div>
        )
    }
}

export default Menu
